import { CREAM } from "../../images/images";
import "./Reviews.css";
export default function Reviews() {
  return (
    <section className="reviews">
      <div className="container">
        <img src={CREAM} alt="" />
        <div className="title title__reviews">Отзывы</div>
      </div>
    </section>
  );
}
